import React from "react";
import {FaReact} from 'react-icons/fa';

const Data = [
    {
        label : 'HOME',
        to : '/'
    },
    {
        label : 'ABOUT ME',
        to : '/about'
    },
    {
        label : 'SKILLS',
        to : '/skills'
    },
    {
        label : 'RESUME',
        to : '/resume'
    },
    {
        label : 'PORTFOLIO',
        to : '/portfolio'
    },
    {
        label : 'CONTACT',
        to : '/contact'
    }
]

const Navbar = () => {
    return(
        <div>
            <nav className="navbar">
                <div className="navbar_container">

                </div>
            </nav>
        </div>
    )
}

export default Navbar;
